import React from 'react';
import './SearchResultCard.css'; // 引入 SearchResultCard 的样式文件

const SearchResultCard = ({ result }) => {
  const { image, title, tags, description, url, videoEmbed, mapEmbed } = result;

  return (
    <div className="search-result-card">
      <div className="result-image">
        <img src={image} alt={title} />
      </div>
      <div className="result-details">
        <h3>{title}</h3>
        <div className="tags">
          {tags.map((tag, index) => (
            <span key={index}>{tag}</span>
          ))}
        </div>
        <p>{description}</p>
        {videoEmbed && (
          <div className="video-embed">
            <h4>Video:</h4>
            <div dangerouslySetInnerHTML={{ __html: videoEmbed }} />
          </div>
        )}
        {mapEmbed && (
          <div className="map-embed">
            <h4>Location:</h4>
            <div dangerouslySetInnerHTML={{ __html: mapEmbed }} />
          </div>
        )}
        <a href={url} target="_blank" rel="noopener noreferrer">Visit Website</a>
      </div>
    </div>
  );
};

export default SearchResultCard;
